import React, { useState, useEffect } from "react";
import Modal from "react-modal";

Modal.setAppElement("#root");

const QuestionsTable = () => {
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState("");
  const [questions, setQuestions] = useState([]);
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [questionText, setQuestionText] = useState("");
  const [editingQuestion, setEditingQuestion] = useState(null);

  useEffect(() => {
    fetchCategories();
  }, []);

  useEffect(() => {
    if (selectedCategory) fetchQuestions(selectedCategory);
  }, [selectedCategory]);

  const fetchCategories = async () => {
    try {
      const response = await fetch("http://127.0.0.1:5000/api/categories");
      const data = await response.json();
      setCategories(data);
    } catch (error) {
      console.error("Error fetching categories:", error);
    }
  };

  const fetchQuestions = async (categoryId) => {
    try {
      const response = await fetch(`http://127.0.0.1:5000/api/get_questions?category_id=${categoryId}`);
      const data = await response.json();
      setQuestions(data);
    } catch (error) {
      console.error("Error fetching questions:", error);
    }
  };

  const handleAddOrEditQuestion = async (e) => {
    e.preventDefault();
    const url = editingQuestion
      ? `http://127.0.0.1:5000/api/questions/${editingQuestion.id}`
      : "http://127.0.0.1:5000/api/questions";
    const method = editingQuestion ? "PUT" : "POST";

    try {
      const response = await fetch(url, {
        method,
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ text: questionText, category_id: selectedCategory }),
      });
      if (response.ok) {
        fetchQuestions(selectedCategory);
        closeModal();
      }
    } catch (error) {
      console.error("Error saving question:", error);
    }
  };

  const handleEdit = (question) => {
    setEditingQuestion(question);
    setQuestionText(question.text);
    setIsModalOpen(true);
  };

  const handleDisable = async (questionId) => {
    try {
      await fetch(`http://127.0.0.1:5000/api/questions/${questionId}`, { method: "DELETE" });
      fetchQuestions(selectedCategory);
    } catch (error) {
      console.error("Error disabling question:", error);
    }
  };

  const closeModal = () => {
    setIsModalOpen(false);
    setQuestionText("");
    setEditingQuestion(null);
  };

  return (
    <div>
      <h2>Manage Questions</h2>
      <label>Category:</label>
      <select value={selectedCategory} onChange={(e) => setSelectedCategory(e.target.value)}>
        <option value="">Select Category</option>
        {categories.map((cat) => (
          <option key={cat.id} value={cat.id}>{cat.name}</option>
        ))}
      </select>

      {selectedCategory && (
        <>
          <button onClick={() => setIsModalOpen(true)}>Add Question</button>
          <ul>
            {questions.map((q) => (
              <li key={q.id}>
                {q.text}
                <button onClick={() => handleEdit(q)}>Edit</button>
                <button onClick={() => handleDisable(q.id)}>Disable</button>
              </li>
            ))}
          </ul>
        </>
      )}

      <Modal isOpen={isModalOpen} onRequestClose={closeModal} className="modal-content" overlayClassName="modal-overlay">
        <h2>{editingQuestion ? "Edit Question" : "Add Question"}</h2>
        <form onSubmit={handleAddOrEditQuestion}>
          <label>Question:</label>
          <input type="text" value={questionText} onChange={(e) => setQuestionText(e.target.value)} required />
          <div>
            <button type="button" onClick={closeModal}>Cancel</button>
            <button type="submit">Save</button>
          </div>
        </form>
      </Modal>
    </div>
  );
};

export default QuestionsTable;
